import './index.css';
import {books} from './book';
import Book from './books';
import React from 'react';



const App=()=>{
    return(
        <section className='booklist'>
            {books.map((books)=>{
                return(
                    <Book {...books} key = {books.id}/>

                ) 
        })};
        </section>
    );
};

export default App;
